import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
<table class="demo">
	<caption>Table 1</caption>
	<thead>
	<tr>
		<th>{data.name}</th>
		<th></th>
		<th></th>
	</tr>	</thead>	<tbody>	<tr>
		<td>&nbsp;{data.desc}</td>
		<td>&nbsp;</td>
		<td><span style="font-weight: 700; text-align: center; background-color: rgb(240, 240, 240);">{data.price}</span>&nbsp;</td>
	</tr>
	</tbody>
</table>

  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
